import React from 'react';
import Link from 'next/link';

const NavLink = ({haref, childrem}) =>{
    return(
        <Link href={href}>
            <a>{ childrem }</a>
        </Link>
    )
}

const NavBar = () =>{
    return(
        <div className ='bg-gray-500 py-4'>
            <NavLink href={href}>Sobre</NavLink>
            <NavLink href={href}>Cadastro</NavLink>
            <NavLink href={href}>Entrar</NavLink>
        </div>  
    )
}
export default NavBar;
